import React from "react";
import * as myProjectService from "../services/myProjectService";
import {
  // Card,
  // CardHeader,
  // CardBody,
  CardTitle,
  // CardFooter,
  Row,
  Col
} from "reactstrap";
// import Icons from "../views/Icons/Icons";

// import ProfileCard from "../components/ProfileCard";
// import CardAuthor from "components/CardElements/CardAuthor.jsx";
// import FormInputs from "components/FormInputs/FormInputs.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      // myProject: []
      firstName: "",
      lastName: "",
      certifications: "",
      specializations: "",
      yogaStyle: "",
      bio: "",
      rates: "",
      location: "",
      website: "",
      email: "",
      phone: "",
      image: ""
      // id: 0

      // yoga: {}
    };
  }

  componentDidMount() {
    debugger;
    console.log(this.props.location.state);
    if (this.props.location.state !== undefined) {
      let newState = this.props.location.state;
      // this.setState({ myProject: newState.myProject });
      this.setState({
        firstName: newState.firstName,
        lastName: newState.lastName,
        certifications: newState.certifications,
        specializations: newState.specializations,
        yogaStyle: newState.yogaStyle,
        bio: newState.bio,
        rates: newState.rates,
        location: newState.location,
        image: newState.image,
        website: newState.website,
        email: newState.email,
        phone: newState.phone,
        id: newState.id
      });
    } else {
      return null;
    }
  }
  handleChange = e => {
    // debugger;
    this.setState({
      [e.target.name]: e.target.value
    });
  };

  onSubmit = e => {
    e.preventDefault();
    // console.log(values);
    debugger;
    const payload = {
      // myProject: this.state.myProject
      firstName: this.state.firstName,
      lastName: this.state.lastName,
      certifications: this.state.certifications,
      specializations: this.state.specializations,
      yogaStyle: this.state.yogaStyle,
      bio: this.state.bio,
      rates: this.state.rates,
      location: this.state.location,
      image: this.state.image,
      website: this.state.website,
      email: this.state.email,
      phone: this.state.phone,
      id: this.state.id
    };
    if (this.props.location.state === undefined) {
      myProjectService
        .submitProfile(payload)
        .then(this.onSuccess)
        .catch(this.onError);
    } else {
      myProjectService
        .updateProfile(this.props.location.state, payload)
        .then(this.onSuccess)
        .catch(this.onError);
    }

    // this.props.location.state === undefined
    //   ? myProjectService
    //       .submitProfile(payload)
    //       .then(this.onSuccess)
    //       .catch(this.onError)
    //   : myProjectService
    //       .updateProfile(this.props.location.state, payload)
    //       .then(this.onSuccess)
    //       .catch(this.onError);
  };

  onSuccess = payload => {
    debugger;
    console.log("successful  ya", payload);
    this.props.history.push("/user-page/");
    console.log(this.props);
    // const id = e.target.id;
    // this.props.history.push("/icons/" + id);
    // console.log(this.props.match.params.id);
  };

  onError = () => {
    debugger;
    console.log("boo boo");
  };

  render() {
    // <Icons data={this.state} />;
    // const yogi = this.state.myProject;

    return (
      <React.Fragment>
        <div className="content">
          {/* <br />
        <br />
        <br /> */}
          <Row>
            <Col xs={2} />
            <Col xs={8}>
              {/* <Col xs={8}> */}
              <div className="content-wrapper">
                <div className="content-heading" />
                <div className="row">
                  <div className="col-xl-12">
                    <div className="card card-default">
                      <div className="card-body">
                        {/* Flat make resvervation */}
                        <section className="flat-row contact-2">
                          <div className="container">
                            <div className="row">
                              <div className="col-md-12">
                                <div className="reservation-page-right">
